import React from 'react';

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-secondary">
            <a class="navbar-brand ms-3 fw-bold" href="#">Counter-App<span class="badge bg-primary">New</span></a>
        </nav >
    );
}

export default Navbar;
